import React from "react";
import { useLocation } from "react-router-dom";

function Form() {
  const location = useLocation();

  return (
    <div className="form">
      <div className="container">
        <div className="form-content">
          <h2>
            {location.pathname === "/login" ? "Login User" : "Register User"}
          </h2>
        </div>
      </div>
    </div>
  );
}

export default Form;
